transforms.result:
*,
*::before,
*::after {
  box-sizing: border-box;
  margin: 0;
}

/**
 * Remove focus styles for non-keyboard focus.
 */
 :focus:not(:focus-visible) {
  outline: 0;
  box-shadow: none;
}

/**
 * Cross-browser styles for explicit focus via 
 * keyboard-based (eg Tab) navigation or the
 * .focus-visible utility class.
 */
:focus:not(input):not(textarea),
.focus-visible:focus:not(:focus-visible):not(input):not(textarea) {
  outline: 0;
  box-shadow: 0 0 0 .1rem #0094cb;
}

input:focus,
textarea:focus,
input.focus-visible:focus:not(:focus-visible),
textarea.focus-visible:focus:not(:focus-visible) {
  outline: 0;
  box-shadow: 0 1px 3px 0 rgb(0 0 0 / 0.1), 0 1px 2px -1px rgb(0 0 0 / 0.1);
}

html {
  color: #eff0f1;
  background-color: rgb(15 23 42);
  font-family: "Aktiv Grotesk","Segoe UI",Helvetica,Arial,sans-serif,"Apple Color Emoji","Segoe UI Emoji","Segoe UI Symbol";
  font-size: 16px;
  word-spacing: 1px;
  -ms-text-size-adjust: 100%;
  -webkit-text-size-adjust: 100%;
  -moz-osx-font-smoothing: grayscale;
  -webkit-font-smoothing: antialiased;
  box-sizing: border-box;
}

body, html {
  height: 100%;
}

h1, h2, h3, .h1, .h2, .h3 {
  font-family: 'Roboto Slab', serif;
  font-weight: 700;
  line-height: 1.25;
}

h1, .h1 {
  margin-bottom: 1rem;
  font-size: 1.5rem;
}

h2, h3, .h2, .h3 {
  margin-bottom: 0.5rem
}

h2, .h2 {
  font-size: 1.125rem;
}

h3, .h3 {
  font-size: 1rem;
}

p {
  font-size: 0.875rem;
}

a {
  cursor: pointer;
  text-decoration: underline;
}

a:hover {
  text-decoration: none;
}

/* Prevents scrollbar from changing content width */
@media screen and (min-width: 960px) {
  html {
    width: 100vw;
    overflow-x: hidden;
  }
}

.Vue-Toastification__toast--info {
  background-color: #7C3AED!important;
}
